import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Table, Card, Button, Spinner, Alert } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { format } from 'date-fns';

const History = () => {
  const [historique, setHistorique] = useState<any[]>([]);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string>('');

  useEffect(() => {
    axios.get('http://localhost:5000/api/history')
      .then(response => {
        setHistorique(response.data);
        setLoading(false);
      })
      .catch(error => {
        // Gestion détaillée des erreurs
        if (error.response) {
          setError(`Erreur du serveur : ${error.response.status}`);
        } else if (error.request) {
          setError('Erreur de communication avec le serveur.');
        } else {
          setError('Erreur inconnue.');
        }
        setLoading(false);
        console.error('Erreur:', error);
      });
  }, []);

  const formatDate = (date: string) => {
    return format(new Date(date), 'dd/MM/yyyy HH:mm');
  };

  return (
    <Container className="mt-4">
      <Row className="mb-3">
        <Col>
          <h2 className="text-center text-primary">Historique des Stocks</h2>
        </Col>
      </Row>

      {error && (
        <Row>
          <Col>
            <Alert variant="danger">
              {error}
            </Alert>
          </Col>
        </Row>
      )}

      {!loading ? (
        <Row>
          <Col>
            <Card className="shadow-lg">
              <Card.Body>
                <Table striped bordered hover responsive>
                  <thead className="table-light">
                    <tr>
                      <th>Produit</th>
                      <th>Date</th>
                      <th>Type</th>
                      <th>Quantité</th>
                    </tr>
                  </thead>
                  <tbody>
                    {historique.length > 0 ? (
                      historique.map((entry, index) => (
                        <tr key={index}>
                          <td>{entry.produit}</td>
                          <td>{formatDate(entry.date)}</td>
                          <td>{entry.type}</td>
                          <td>{entry.quantite}</td>
                        </tr>
                      ))
                    ) : (
                      <tr>
                        <td colSpan={4} className="text-center">Aucune donnée disponible</td>
                      </tr>
                    )}
                  </tbody>
                </Table>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      ) : (
        <Row>
          <Col className="d-flex justify-content-center">
            <Spinner animation="border" variant="primary" />
          </Col>
        </Row>
      )}

      <Row className="mt-3">
        <Col className="d-flex justify-content-center">
          <Link to="/">
            <Button variant="secondary">Retour au Tableau de Bord</Button>
          </Link>
        </Col>
      </Row>
    </Container>
  );
};

export default History;
